def custom_decode(data, salt='R6qS2Eppe2bDaBHw', magic=2186):
    result = bytearray()
    for b, salt_char in zip(data, cycle(salt.encode())):
        result.append((b - salt_char - magic) % 256)
    return bytes(result)


